    public function getSourceContext()
    {
        return new Twig_Source("<!DOCTYPE html>
<html>
    <head>
        <meta charset=\"UTF-8\">
        <title>{% block title %}Welcome!{% endblock %}</title>
        <link rel=\"stylesheet\" href=\"{{ asset('css/base.css') }}\">
        {% block stylesheets %}{% endblock %}
    </head>
    <body>
        <div class=\"header\">
            <p class=\"logo\">Logo missing here</p>
            <ul class=\"head\">
                {% if not app.user %}
                <li class=\"headBtn\"><a href=\"{{ path('login') }}\">Login</a></li>
                <li class=\"headBtn\"><a href=\"{{ path('register') }}\">Register</a></li>
                {% elseif app.user.username != null %}
                    <li class=\"headBtn\"><a href=\"{{ path('logout') }}\">Logout</a></li>
                    <li class=\"headBtn\"><a>Logged as {{ app.user.username }}</a></li>
                {% endif %}
            </ul>
        </div>
        {% if app.user %}
        <div class=\"navigation\">
            <ul class=\"nav\">
                {% block nav %}
                    <li class=\"navBtn\"><a class=\"active\" href=\"#registercar\">Register a car</a></li>
                    <li class=\"navBtn\"><a href=\"#progress\">Check progress</a></li>
                    <li class=\"navBtn\"><a href=\"#users\">See list of users</a></li>
                    <li class=\"navBtn\"><a href=\"#workers\">See list of workers</a></li>
                    <li class=\"navBtn\"><a href=\"#services\">See list of services</a></li>
                {% endblock %}
            </ul>
        </div>
        {% endif %}
        <div class=\"content\"> {% block content %}{% endblock %} </div>
    </body>
</html>
", "base.html.twig", "/var/www/html/Projektas/templates/base.html.twig");
